import logo from './logo.svg';
import './style/style.css'

function App() {
  return (
    <div className="App">
     <div className="parallax">
       <img src="https://aeoneal.com/imagery/brain-reverse-cutout.svg"/>
       </div>
       <div className="after">
         <h1>PARALLAX EFFECT</h1>
         </div>
    </div>
  );
}

export default App;
